import React from "react";
import TextField from "../components/ui/TextField";
import "../assets/styles/profile.css";
import Button from "../components/ui/Button";
import { useState } from "react";
import ModalChangePass from "../components/modals/ModalChangePass";
import { useAuth } from "../components/AuthContext";
import axios from "axios";

const removeErrMsg = () => {
  document.querySelectorAll("#errmsg")?.forEach((e) => e.remove());
};

function Profile() {
  const user = useAuth();

  const [profile, setProfile] = useState({
    name: user?.fullname,
    gender: user?.gender ? "Nam" : "Nữ",
    dateOfBirth: user?.dateOfBirth,
    email: user?.email,
    nameLogin: user?.username,
    password: "password",
    address: user?.address,
    phone: user?.phone,
  });
  const [isOpen, setIsOpen] = useState(false);

  const onChangeText = (key, value) => {
    removeErrMsg();
    setProfile({
      ...profile,
      [key]: value,
    });
  };

  const handleUpdate = async () => {
    try {
      await axios
        .put(
          "http://localhost:8000/api/v1/users/update_info/",
          {
            email: profile.email,
            dateofbirth: profile.dateOfBirth,
            username: profile.nameLogin,
            fullname: profile.name,
            gender: profile.gender == "Nam" ? "True" : profile.gender == "Nữ" ? "False" : "",
            phonenumber: profile.phone,
            address: profile.address,
          },
          {
            headers: {
              Authorization: "Bearer " + localStorage.getItem("token"),
            },
          }
        )
        .then((res) => {
          if (res?.statusText === "OK") {
            localStorage.setItem("updateuserSuccess", true);
            localStorage.setItem("id", res?.data.manguoidung);
            localStorage.setItem("username", res?.data.username);
            localStorage.setItem("email", res?.data.email);
            localStorage.setItem("fullname", res?.data.fullname);
            localStorage.setItem("gender", res?.data.gender);
            localStorage.setItem("dateOfBirth", res?.data.dateofbirth);
            localStorage.setItem("phone", res?.data.phonenumber);
            localStorage.setItem("address", res?.data.address);
            window.location.reload();
          } else {
            localStorage.setItem("updateuserSuccess", false);
          }
        });
    } catch (error) {
      localStorage.setItem("updateuserSuccess", false);
    }
  };

  return (
    <div className="profile-main">
      <h1>Thông tin cá nhân</h1>
      <div className="card-detail card-modal__item flex" style={{gap:'40px', alignItems:'flex-start'}}>
                        <div className="event-item">
                        <TextField title={'Chủ sở hữu'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Ngày bắt đầu'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Số người tham dự'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Phí phạt (VND)'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Số dư nợ (VND)'} value={'a'} onChange={()=>{}}/>
                        </div>
                        <div className="event-item">
                        <TextField title={'Mã sự kiện'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Ngày kết thúc'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Tổng chi phí (VND)'} value={'a'} onChange={()=>{}}/>
                    <TextField title={'Đã thanh toán (VND)'} value={'a'} onChange={()=>{}}/>
                    
                        </div>
                        
                    </div>
      {isOpen && (
        <ModalChangePass isOpen={isOpen} onClose={() => setIsOpen(false)} />
      )}
    </div>
  );
}

export default Profile;
